import React from 'react';
import { Navbar, Nav, NavItem, NavDropdown} from 'reactstrap';
import { Link } from "@reach/router";
class Menu extends React.Component{
    render(){
     return(
         <Navbar inverse collapseOnSelect>
             <Navbar.Header>
                 <Navbar.Brand>
                     <Link to="/">Adopt me!</Link>
                 </Navbar.Brand>
                 <Navbar.Toggle />
             </Navbar.Header>
             <Navbar.Collapse>
                 <Nav>
                     <NavItem eventKey={1} >
                         Link
                     </NavItem>
                     <NavItem eventKey={2}>
                         Link
                     </NavItem>
                 </Nav>
                 <Nav pullRight>
                     <NavItem eventKey={1} >
                         Link Right
                     </NavItem>
                     <NavItem eventKey={2} >
                         Link Right
                     </NavItem>
                 </Nav>
             </Navbar.Collapse>
         </Navbar>
     );
    }
}
export default Menu;
